import React from 'react';
import { useState } from 'react';
import { Group, Code } from '@mantine/core';
import {
  IconBellRinging,
  IconFingerprint,
  IconKey,
  IconSettings,
  Icon2fa,
  IconDatabaseImport,
  IconReceipt2,
  IconSwitchHorizontal,
  IconLogout,
  IconBuildingCommunity,
  IconUser,
} from '@tabler/icons-react';
import { MantineLogo } from '@mantine/ds';
import '@mantine/core/styles.css';
import classes from '../../../styles/SettingsNavigation.module.css';

const data = [
  { link: '', label: 'Organization Info', icon: IconUser },
  { link: '', label: 'University Info', icon: IconBuildingCommunity },
  { link: '', label: 'Notifications', icon: IconBellRinging },
  { link: '', label: 'Login Info', icon: IconKey },
  { link: '', label: 'Other Settings', icon: IconSettings },
];

export function SettingsNavigation() {
  const [active, setActive] = useState('Organization Info');

  const links = data.map((item) => (
    <a
      className={classes.link}
      data-active={item.label === active || undefined}
      href={item.link}
      key={item.label}
      onClick={(event) => {
        event.preventDefault();
        setActive(item.label);
      }}
    >
      <item.icon className={classes.linkIcon} stroke={1.5} />
      <span>{item.label}</span>
    </a>
  ));

  return (
    <body>
      <div className={classes.settingsContainer}>
        <div className={classes.navigation}>
          <nav className={classes.navbar}>
            {/* Settings Navigation */}
            <div className={classes.navbarMain}>
              <Group className={classes.header} justify="space-between"></Group>
              {links}
              <Group className={classes.header} justify="space-between"></Group>
              <Group className={classes.header} justify="space-between"></Group>
              <Group className={classes.header} justify="space-between"></Group>
              <Group className={classes.header} justify="space-between"></Group>
              <Group className={classes.header} justify="space-between"></Group>
              <Group className={classes.header} justify="space-between"></Group>
            </div>
            
            {/* Change Account and Logout */}
            <div className={classes.footer}>
              
              <a href="#" className={classes.link} onClick={(event) => event.preventDefault()}>
                <IconLogout className={classes.linkIcon} stroke={1.5} />
                <span>Logout</span>
              </a>
            </div>
          </nav>
        </div>
        <div className={classes.info}>
        
        </div>
      </div>
    </body>

  );
}
